import React, { Fragment } from 'react';

const Header = () => (
  <Fragment>
    <header className="top">
      <h1>Catch of The Day</h1>
    </header>
    <h3 className="tagline">
      <span>Fresh Daily</span>
    </h3>
  </Fragment>
);

export default Header;
